                run_name = ['J_DB2.0_Channel', num2str(channelNr) , '_rho', num2str(rho_ref), '_T', num2str(T_ref), '_fp(i)_pe', num2str(pe) , '_Cx', num2str(Cx) , '_i' , num2str(nt) , '_n' , num2str(n) , '_C' , num2str(C), '_b', num2str(b), '_De', num2str(exitDiameter)];
            end
        end
        if testrun == true
            run_name = ['xxx']; % SET DEFAULT
        end
        NewFolder = ['Figures/' run_name];                  % Folder Name (for figures)
        if exist(NewFolder,'dir') == 0 % check if folder exists
            mkdir(NewFolder);                                    % Create directory
        end

        %% Conservative form (with Shock-Capturing)
            

            % Nozzle figure %
            NozzleShape = figure(1);
            plot([x_throat x_throat],[r_throat -r_throat],'k--')
            hold on
            plot([x_vent x_vent],[r_vent -r_vent],'--') 
            plot([x_res x_res],[r_res -r_res],'--')
            plot(x,r,'k','linewidth',2)
            plot(x,-r,'k','linewidth',2)
            hold off
            D_min_max = r_throat/r_max;
            D_exit = r_vent*2;
            legend(['D_{min}/D_{max} = ', num2str(D_min_max)],['D_{exit} = ', num2str(D_exit), ' m'])
            ylabel('Channel Radius [-]')
            xlabel('z/L [-]')
            name = ['NozzleShape.png'];
            saveas(NozzleShape, ['Figures/' run_name '/' name]);
            
            channelRadius_d = figure(16);
            plot([x_d_throat x_d_throat],[r_d(throat) -r_d(throat)],'k--')
            hold on
            plot(x_d,r_d,'k','linewidth',2)
            plot(x_d,-r_d,'k','linewidth',2)
            hold off
            D_min_max = r_throat/r_max;
            D_exit = r_d(end)*2;
            D_throat = 2*r_d(throat);
            legend(['D_{min}/D_{max} = ', num2str(round(D_min_max,1))],['D_{exit} = ', num2str(D_exit), ' m'],['D_{throat} = ', num2str(round(D_throat,1)),' m'] );
            ylabel('Channel Radius [m]')
            xlabel('z [m]')
            name = ['channelRadius_d.png'];
            saveas(channelRadius_d, ['Figures/' run_name '/' name]);
            tic % start of run-time %
            exit = n;
            [Cm, CM, CV, CT, Cp, Crho, Cmdot, x_g, rho_d, T_d] = conservative_with_Shock(x, dx, n, C, A, nt, y, throat, Cx, Rg, exit, pe, run_name, r_res_d, L, cv, r_throat, T_ref, rho_ref, p_ref, nucleation, channelNr, verification, b, M_ref, r, c, c_d, r_sub);
            cons = toc; % end of run-time %
            fprintf('Solution time for conservative form is %0.3g seconds', cons)
        % end

        %% Ploting the above data
        x_throat = [x(throat)];
        x_d_throat = [x_d(throat)];
        bb = figure(12);
        subplot(411)
        plot(x, CM, 'b', 'linewidth', 2)
        hold on
        xline(x_throat,'k--')
        grid minor
        title('Parameters of Quasi - 1D Nozzle Flow', 'FontSize', 13, 'FontWeight', 'bold', 'FontAngle', 'italic')
        ylabel('M', 'FontWeight', 'bold', 'FontSize', 11)

        subplot(412)
        plot(x, CT, 'g', 'linewidth', 2)
        hold on
        xline(x_throat,'k--')
        ylabel('T/T_0', 'FontWeight', 'bold', 'FontSize', 11)
        grid minor

        subplot(413)
        plot(x, Crho, 'r', 'linewidth', 2)
        hold on
        xline(x_throat,'k--')
        ylabel('\rho/\rho_0', 'FontWeight', 'bold', 'FontSize', 11)
        grid minor

        subplot(414)
        plot(x, Cp, 'm', 'linewidth', 2)
        hold on
        xline(x_throat,'k--')%plot([x_throat x_throat],[min(Cp) max(Cp)],'k--')
        ylabel('P/P_0', 'FontWeight', 'bold', 'FontSize', 11)
        xlabel('Non-Dimensional Length of the Nozzle', 'FontWeight', 'bold', 'FontSize', 11)
        grid minor
        name = ['qualitative_aspects.png'];
        saveas(bb, ['Figures/' run_name '/' name]);

        q = figure(17);
        plot(x, Cm, 'b', 'linewidth', 2)
        grid minor
        xlabel('x/L', 'FontWeight', 'bold', 'FontSize', 11)
        ylabel('\rho VA/\rho_{o}V_{o}A_{0}', 'FontWeight', 'bold', 'FontSize', 11)
        text = ['Non-Dimensional Mass Flow Distribution (i = ' , num2str(nt) , ')'];
        title(text,'FontWeight', 'bold', 'FontSize', 13, 'FontAngle', 'italic')
        name = ['Non_Dim_mass_flow_.png'];
        saveas(q, ['Figures/' run_name '/' name]);

        qq = figure(13);
        %hold on
        plot(x_g, Cmdot, 'b', 'linewidth', 2)
        hold on
        xline(x_d_throat,'k--')
        grid minor
        xlabel('x/L', 'FontWeight', 'bold', 'FontSize', 11)
        ylabel('\rho VA', 'FontWeight', 'bold', 'FontSize', 11)
        text = ['Mass Flow Distribution (i = ' , num2str(nt) , ')'];
        title(text,'FontWeight', 'bold', 'FontSize', 13, 'FontAngle', 'italic')
        name = ['Dim_mass_flow_.png'];
        saveas(qq, ['Figures/' run_name '/' name]);
    end
